	private static int getCountOfLongestSubstring(String str) {
		Set<Character> setOfStringCharacters = str.chars().mapToObj(e->(char)e).collect(Collectors.toSet());
		Map<Character,Boolean> visitedStatus = new HashMap<>();
		setOfStringCharacters.stream().forEach(c->visitedStatus.put(c,false));
		StringBuilder substringBuilder = new StringBuilder();
		String inputString = str;
		List<StringBuilder> linkedListSb = new LinkedList<>();
		int headPointer =0;
		int lengthOfString=inputString.length();
		for(int i =headPointer;i<lengthOfString;i++) {
			if(visitedStatus.get(inputString.charAt(i))==false) {
				substringBuilder.append(String.valueOf(inputString.charAt(i)));
			    visitedStatus.put(inputString.charAt(i), true);			    
			}
			else {		
				linkedListSb.add(substringBuilder);
				substringBuilder = new StringBuilder();
				headPointer=headPointer+1;
				i=headPointer-1;
				setOfStringCharacters.stream().forEach(c->visitedStatus.put(c,false));
			}
			
	}
		linkedListSb.add(substringBuilder);
		System.out.println(linkedListSb);
		String longestSubstring=linkedListSb.get(0).toString();
		int longestSubstringLength=longestSubstring.length();
		for(int i=0;i<linkedListSb.size();i++) {
			if(linkedListSb.get(i).length()>longestSubstringLength) {				
				longestSubstringLength=linkedListSb.get(i).length();
				longestSubstring=linkedListSb.get(i).toString();
			}
		}
		System.out.println("Longest Substring is "+longestSubstring+ " with a length of "+longestSubstringLength);
		return longestSubstringLength;
	}	
		
